import React from "react";
import { useTeaserPropertiesQuery } from "../../../../generated/graphql";
import { CircularProgress, Grid } from "@material-ui/core";
import { PropertyCard } from "./PropertyCard";

interface Props {

}



export const PropertyTeaser: React.FC<Props> = () => {

    const {data, loading, error} = useTeaserPropertiesQuery();

    if(loading){
        return (
            <CircularProgress />
        )
    }

    if(data && data.allProperties){

       return (
        <Grid
        container
        spacing={2}
        direction="row"
        justify="flex-start"
        alignItems="flex-start"
    >
        {data.teaserProperties?.map(prop => (
            <Grid item xs={12} sm={6} md={3} key={prop.id}>
               <PropertyCard property={prop} />
             </Grid>
        ))}
    </Grid>
       ) 
    }

    if(error){
        return (
            <div>
                {error}
            </div>
        ) 
     }
     return (
        <CircularProgress />
    )
}
